import {cloneElement, React, useState} from 'react';
import * as style from "../../css/focusedList";

export default function Focused(props) {
  const [focused, setFocused] = useState([props.focused])

  const renderFocusedList = () => {
    focused.map((i, item) => {
      console.log(i, item)
    })
    return focused.map((i, item) => {
      <div key={i}>{}</div>
    })
  }

  console.log(props.focused)
  return (
    <div onClick={() => console.log(focused)} style={style.container}>
      {renderFocusedList()}
    </div>
  )
}
